import React from 'react';
import { StyleSheet, View, Text } from 'react-native';


export const headerstyles = StyleSheet.create({
    container: {
      width:'100%',
      height:'100%',
      backgroundColor:'#E7E6E4'
    },
    magnifyingglass:{
        color:"#434343",
        display:"flex",
        justifyContent:"flex-start",
        alignItems:"flex-end"
    }
  });
